    const createSliderWithTooltip = Slider.createSliderWithTooltip;
const Range = createSliderWithTooltip(Slider.Range);
    return(
        <section className="user-select">
            <div className="want-ingred">
                <h3>Ingredients that I want to include in recipe</h3>
            </div>
            <div className="nowant-ingred">
                <h3>Ingredients that I don't like to include</h3>
            </div>
            <div className="CF">
                <h3>give me some recommendation</h3>
                <Slider min={0} max={10000} onChange={value => {
      this.updateSelectedRange(value);
    }} />
            </div>

        </section>
    )
}
